--
-- Name: v_current_record; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_current_record AS
 SELECT task_tracings.id,
    task_tracings.date,
    task_tracings.start_time,
    task_tracings.end_time,
    task_tracings.duration,
    task_tracings.is_pause,
    task_tracings.launch_type_id,
    task_tracings.task_id,
    task_tracings.user_id,
    task_tracings.is_recorded,
    task_tracings.inserted_at,
    task_tracings.updated_at
   FROM public.task_tracings
  WHERE (task_tracings.is_recorded = false);


ALTER TABLE public.v_current_record OWNER TO postgres;

--
-- Name: v_projects_clients_details; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_projects_clients_details AS
 SELECT projects.id AS project_id,
    users.id AS client_id,
    users.username AS clients_name,
    users.email,
    users.phone_number,
    active_clients.rights_clients_id,
    rights_clients.name AS rights_name
   FROM (((public.projects
     JOIN public.active_clients ON ((projects.active_client_id = active_clients.id)))
     JOIN public.users ON ((users.id = active_clients.user_id)))
     JOIN public.rights_clients ON ((rights_clients.id = active_clients.rights_clients_id)));


ALTER TABLE public.v_projects_clients_details OWNER TO postgres;

